import React, { memo } from "react";
import Background from "../components/Background";
import Logo from "../components/Logo";
import Header from "../components/Header";
import Button from "../components/Button";

const HomeScreen = ({ navigation }) => (
  <Background>
    <Logo />
    <Header>Select Catogory</Header>
    <Button mode="contained" onPress={() => navigation.navigate("LoginScreen")}>SERVICE</Button>
    <Button mode="outlined" onPress={() => navigation.navigate("StdScreen")} >Student</Button>
    <Button mode="outlined" onPress={() => navigation.navigate("AdminDashboard")} >Admin</Button>
  </Background>
);

export default memo(HomeScreen);
